export default class Plugin extends Patch {
    name = "DMX Hypeman Drums"
    version = "1.0.0"
    description = "DMX provides unnecessary adlibs over tracks that probably don't need them to add some raw, Ruff Ryder energy. RIP."
    author = "@DMXHero, Adam A"

    load()
		{
		assets.sounds["se_don_orig"] = assets.sounds["se_don"]
		assets.sounds["se_ka_orig"] = assets.sounds["se_ka"]
		assets.sounds["neiro_1_don_orig"] = assets.sounds["neiro_1_don"]
		assets.sounds["neiro_1_ka_orig"] = assets.sounds["neiro_1_ka"]
		assets.sounds["v_start_orig"] = assets.sounds["v_start"]
		assets.sounds["v_diffsel_orig"] = assets.sounds["v_diffsel"]
		assets.sounds["v_songsel_orig"] = assets.sounds["v_songsel"]
		assets.sounds["se_balloon_orig"] = assets.sounds["se_balloon"]
		var promise =
				snd.sfxGain.load(new RemoteFile(don())).then(sound => {assets.sounds["DMX_don"] = sound})
		.then(	snd.sfxGain.load(new RemoteFile(ka())).then(sound => {assets.sounds["DMX_ka"] = sound})	)
		.then(	snd.sfxGain.load(new RemoteFile(songstart())).then(sound => {assets.sounds["DMX_songstart"] = sound})	)
		.then(	snd.sfxGain.load(new RemoteFile(difficultyselect())).then(sound => {assets.sounds["DMX_difficultyselect"] = sound})	)
		.then(	snd.sfxGain.load(new RemoteFile(songsel())).then(sound => {assets.sounds["DMX_songsel"] = sound})	)
		.then(	snd.sfxGain.load(new RemoteFile(balloon())).then(sound => {assets.sounds["DMX_balloon"] = sound})	)
		this.log("Loaded DMX sounds")
		return promise
		}
	stop(){
		assets.sounds["se_don"] 		= assets.sounds["se_don_orig"]
		assets.sounds["se_ka"] 			= assets.sounds["se_ka_orig"]
		assets.sounds["neiro_1_don"] 	= assets.sounds["neiro_1_don_orig"]
		assets.sounds["neiro_1_ka"] 	= assets.sounds["neiro_1_ka_orig"]
		assets.sounds["v_start"] 		= assets.sounds["v_start_orig"]
		assets.sounds["v_diffsel"] 		= assets.sounds["v_diffsel_orig"]
		assets.sounds["v_songsel"] 		= assets.sounds["v_songsel_orig"]
		assets.sounds["se_balloon"] 		= assets.sounds["se_balloon_orig"]
		this.log("Stopped DMX sounds")
		}
	start()
		{
		var promise =
			  snd.sfxGain.load(new RemoteFile(don())).then(sound => {
				assets.sounds["se_don"] = assets.sounds["DMX_don"]
				assets.sounds["neiro_1_don"] = assets.sounds["DMX_don"]
			  })
		.then(snd.sfxGain.load(new RemoteFile(ka()))).then(sound => {
				assets.sounds["se_ka"] = assets.sounds["DMX_ka"]
				assets.sounds["neiro_1_ka"] = assets.sounds["DMX_ka"]
		})
		.then(snd.sfxGain.load(new RemoteFile(songstart()))).then(sound => {
			assets.sounds["v_start"] = assets.sounds["DMX_songstart"]
		})
		.then(snd.sfxGain.load(new RemoteFile(difficultyselect()))).then(sound => {
			assets.sounds["v_diffsel"] = assets.sounds["DMX_difficultyselect"]
		})
		.then(snd.sfxGain.load(new RemoteFile(songsel()))).then(sound => {
			assets.sounds["v_songsel"] = assets.sounds["DMX_songsel"]
		})
		.then(snd.sfxGain.load(new RemoteFile(balloon()))).then(sound => {
			assets.sounds["se_balloon"] = assets.sounds["DMX_balloon"]
		})
		// .then(assets.sounds["se_don"] = assets.sounds["DMX_don"])
		// .then(assets.sounds["neiro_1_don"] = assets.sounds["DMX_don"])
		// .then(assets.sounds["se_ka"] = assets.sounds["DMX_ka"])
		// .then(assets.sounds["neiro_1_ka"] = assets.sounds["DMX_ka"])
		// .then(assets.sounds["v_start"] = assets.sounds["DMX_letsgetiton"])

		this.log("Started DMX sounds")
		return promise
		}
	unload()
		{
		assets.sounds["se_don"] = assets.sounds["se_don_orig"]
		assets.sounds["neiro_1_don"] = assets.sounds["neiro_1_don_orig"]
		assets.sounds["se_ka"] = assets.sounds["se_ka_orig"]
		assets.sounds["neiro_1_ka"] = assets.sounds["neiro_1_orig"]
		assets.sounds["v_start"] = assets.sounds["v_start_orig"]
		assets.sounds["v_diffsel"] = assets.sounds["v_diffsel_orig"]
		assets.sounds["v_songsel"] = assets.sounds["v_songsel_orig"]
		assets.sounds["se_balloon"] = assets.sounds["se_balloon_orig"]
		//delete assets.sounds["se_don_orig"]
		//delete assets.sounds["neiro_1_don_orig"];
		//delete assets.sounds["se_ka_orig"];
		//delete assets.sounds["neiro_1_orig"];
		//delete assets.sounds["DMX_don"];
		//delete assets.sounds["DMX_ka"];
		this.log("Unloaded DMX sounds")
		}
}
				
//DMX SOUND OPTIONS


//SELECT ALTERNATE SOUNDS TO USE DMX SOUND VERSION A OR B
//Original taiko sounds are "se_don.ogg" and "se_ka.ogg" and "neiro_1_don" and "neiro_1_ka"
var useDon = "A";
var useKa = "A";

function don() {if (useDon == "A") return se_uhA();else if (useDon == "B") return se_uhB();}
function ka() {if (useKa == "A") return se_whatA();else if (useKa == "B") return se_whatB();}
function songstart(){return se_comeon();}
function difficultyselect(){return se_growl();}
function songsel(){return se_letsgetiton();}
function balloon(){return se_arfarf();}

	
//DMX SOUND DATA
//DMX "uh" sound version A - "DON"
